from flask import Flask, render_template, request, url_for, flash, redirect, send_from_directory, Response
import boto3
import json
import os
from werkzeug.exceptions import abort
from werkzeug.wsgi import FileWrapper
from io import BytesIO
from base64 import b64encode, urlsafe_b64encode

test_file = 'common_voice_en_38497561.mp3'

z = ''

boto3.setup_default_session(profile_name='AWSIntroTraining-408122842185')

s3 = boto3.resource('s3')
bucketname = 'humainr-aws-intro-bucket'
bucket = s3.Bucket(bucketname)
obj = s3.Object(bucket_name=bucketname, key=test_file)
response = obj.get()
audio_bytes = response['Body']
w = audio_bytes.read()
q = b64encode(w).decode("utf-8")


db = boto3.resource('dynamodb')
tablename = 'AWSIntroTable'
table = db.Table(tablename)
items = table.scan()


app = Flask(__name__)
app.config['SECRET_KEY'] = '1234'

@app.route('/favicon.ico')
def favicon():
    return send_from_directory(os.path.join(app.root_path, 'static'),
                               'favicon.ico', mimetype='image/vnd.microsoft.icon')

@app.route('/')
def index():
    return render_template('index.html', items=items['Items'], w=q)

@app.route('/hello')
def hello_world():
    b = BytesIO(b"blah blah blah")
    w = FileWrapper(file=b, buffer_size=8192)
    return Response(w, mimetype="text/plain", direct_passthrough=True)

@app.route('/<string:post_id>')
def post(post_id):
    for item in items['Items']:
        if item['id'] == post_id:
            return render_template('transcript.html', items=item)

